import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { supabase } from '../supabaseClient';

const Navbar = ({ cartCount, openModal, user }) => {
  const navigate = useNavigate();

  const handleLogout = async () => {
    await supabase.auth.signOut();
    navigate('/');
  };

  return (
    <nav style={navStyle}>
      {/* Brand Identity */}
      <Link to="/" style={logoContainer}>
        <div style={logoIcon}>M</div>
        <h1 style={logoText}>MegaMart</h1>
      </Link>

      {/* Modern Search Bar */}
      <div style={searchWrapper}>
        <input 
          type="text" 
          placeholder="Search for premium products..." 
          style={searchInput} 
        />
        <span style={searchIcon}>üîç</span>
      </div>

      {/* Navigation Actions */}
      <div style={actionsContainer}>
        {user ? (
          <div style={userMenu}>
            <Link to="/profile" style={navLink}>My Orders</Link>
            <button onClick={handleLogout} style={logoutBtn}>Logout</button>
          </div>
        ) : (
          <div style={userMenu}>
            <Link to="/login" style={navLink}>Sign In</Link>
            <Link to="/login" style={signUpBtn}>Join Now</Link>
          </div>
        )}

        {/* Floating Cart Button */}
        <div onClick={openModal} style={cartToggle}>
          <span style={{ fontSize: '20px' }}>üõí</span>
          {cartCount > 0 && <span style={cartBadge}>{cartCount}</span>}
        </div>
      </div>
    </nav>
  );
};

// --- Styles ---
const navStyle = {
  backgroundColor: 'rgba(255, 255, 255, 0.85)',
  backdropFilter: 'blur(12px)',
  padding: '12px 60px',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'space-between',
  boxShadow: '0 4px 20px rgba(0,0,0,0.04)',
  position: 'sticky',
  top: 0,
  zIndex: 1000,
  borderBottom: '1px solid rgba(0,0,0,0.05)'
};

const logoContainer = { textDecoration: 'none', display: 'flex', alignItems: 'center', gap: '10px' };
const logoIcon = { backgroundColor: '#008ECC', width: '38px', height: '38px', borderRadius: '10px', display: 'flex', alignItems: 'center', justifyContent: 'center', color: 'white', fontWeight: '900', fontSize: '20px' };
const logoText = { color: '#1a1a1a', fontSize: '22px', fontWeight: '800', margin: 0, letterSpacing: '-0.5px' };
const searchWrapper = { flex: 1, margin: '0 50px', position: 'relative', maxWidth: '600px' };
const searchInput = { width: '100%', padding: '12px 45px 12px 20px', borderRadius: '14px', border: '1px solid #eee', backgroundColor: '#f8f9fa', fontSize: '14px', outline: 'none' };
const searchIcon = { position: 'absolute', right: '15px', top: '50%', transform: 'translateY(-50%)', opacity: 0.4 };
const actionsContainer = { display: 'flex', gap: '25px', alignItems: 'center' };
const userMenu = { display: 'flex', gap: '20px', alignItems: 'center' };
const navLink = { textDecoration: 'none', color: '#555', fontSize: '14px', fontWeight: '600' };
const logoutBtn = { background: 'none', border: 'none', color: '#FF4D4D', cursor: 'pointer', fontWeight: '600', fontSize: '14px' };
const signUpBtn = { textDecoration: 'none', backgroundColor: '#008ECC', color: 'white', padding: '10px 22px', borderRadius: '12px', fontSize: '14px', fontWeight: '700', boxShadow: '0 4px 10px rgba(0, 142, 204, 0.2)' };
const cartToggle = { cursor: 'pointer', position: 'relative', display: 'flex', alignItems: 'center', backgroundColor: '#f0f9ff', padding: '10px', borderRadius: '12px' };
const cartBadge = { position: 'absolute', top: '-5px', right: '-5px', backgroundColor: '#FF4D4D', color: 'white', fontSize: '10px', minWidth: '18px', height: '18px', borderRadius: '50%', display: 'flex', alignItems: 'center', justifyContent: 'center', fontWeight: 'bold', border: '2px solid white' };

export default Navbar;
